print(spark.conf.get("spark.driver.memory"))

"""### Storage Cache For DataFrame"""

df = spark.range(1000000).toDF("number")

df.cache()
df.count()  # Chạy lần đầu để lưu cache

import time

start = time.time()
df.count()
print("Thời gian chạy sau cache:", time.time() - start)

